   "source": [
    "# Volcanic Eruption in Indonesia\n",
    "\n",
    "Indonesia an archipelago country with more than 13,000 islands is located in the \"Pasific ring of fire\" a series of seismic fault lines around the ocean of Pacific. There are 127 active volcano spread all over the country from north Sumatra in the west to Banda island in the east. With population over 270 million people, this natural event is one of high risks for the people living in the country.\n",
    "\n",
    "This notebook is to explore eruption data from the year 1300 until today for deadly eruption, and visualize it to share the story and observe to get better understanding of this natural event."
   ]
  },
