    "Deathliest eruption was Mount Tambora on Oct, 8 1822 where killed 60K people, followed by Mount Krakatau on Aug, 27, 1883, and then Kelut erupted twice on New Year 1586 and Mei, 19, 1919, killed 10K and 5K respectively.\n",
    "\n",
    "Now let us take a look deadly eruptions that happened in the past 30 years."
