   "source": [
    "e_mounts <- v_events %>% select(elevation_m)\n",
    "ggplot(e_mounts, aes(elevation_m)) +\n",
    "  geom_histogram(aes(x=elevation_m, y=..density..), bins = 50, fill=\"#d3d3d3\", color=\"black\") +\n",
