   "source": [
    "# Conclusion\n",
    "From data visualization and statistic method we can conclude from the data we have as follows:\n",
    "* Java has the most volcanic mountians in the country, may be in the world, make this island the most risky island. More than 60% of the country population, or more than 150 million people live in Java.\n",
    "* The more higher elevaltion of a mountain, the more probability of eruption event.\n",
    "* Most of eruptions are low to moderate explosion with no death and minor damage.\n",
    "* Mountain with elevation between 2,000 to 3,000 (m) are most active volcanos.\n",
    "* Mountains become more active, since the year 1800, however the impact is getting lower, both in the number of deaths as well as injuries.\n",
    "\n",
    "There is a volcanics eruptions competition at Kaggle to predict the next eruption which I plan to develop, hopefully soon. I am still learning machine learning ;-)."
   ]
